import { CHATLIST_URL } from "../utils/consts";
import { 
    // $host, 
    $authhost 
} from "./index";

export const chats = async () => {
    const {data} = await $authhost.get(CHATLIST_URL)
    return data
}
export const userData = async (userNickname) => {
    const {data} = await $host.get(USERDATA_URL + userNickname)
    return data
}
